import React from "react";
import './Header.css';

const Header = () => {
    return (
        <main className="Header">
            <div className="logo">
                <h1>calc</h1>
            </div>
            <div className="select-theme">
                <h4>THEME</h4>
                <div className="radio-buttons">
                    <ul className="list-container">
                        <li><input id="theme1" type="radio" /></li>
                        <li><input id="theme2" type="radio" /></li>
                        <li><input id="theme3" type="radio" /></li>
                    </ul>   
                </div>
            </div>
        </main>
    )
}

export default Header;
